import React from 'react'

function Interested() {
  return (
    <div className='w-h-screen bg-base-300 mt-28'>
      <div className='flex flex-row p-12'>
        <h1 className='font-bold'>Interested working with me ?</h1>
      </div>
    </div>
  )
}

export default Interested
